import React from 'react';
import styled from 'styled-components';
import info from '../data.json'
const Header = () => {
    return (
        <HeaderContainer>
      
            <h1>{info.fullName}</h1>
            
            <ul><li></li>
            <li></li>
            <li></li>
            <li></li>
            <li></li></ul>
        </HeaderContainer>
    );
}

export default Header;

const HeaderContainer=styled.div`
display: flex;
justify-content: space-between;

`
